import React from "react";
import "./SongCard.css";

export default function SongCard({ song }) {
  return (
    <div className="song-card">
      <img src={song.cover} alt={song.songname} className="cover" />
      <h4>{song.songname}</h4>
      <p>{song.artist}</p>
      <audio controls src={song.url}></audio>
    </div>
  );
}
